import { GoogleMap, Marker } from "react-google-maps";
import MapContainer from "./MapContainer";

class Map extends Component {
  render() {
    console.log(this.props.children);
    return (
      <MapContainer>
        <GoogleMap
          defaultZoom={12}
          defaultCenter={{ lat: this.props.lat, lng: this.props.lng }}
        >
          <Marker />
        </GoogleMap>{" "}
      </MapContainer>
    );
  }
}

export default Map;
